class Solution:
    def leftMostColumnWithOne0(self, binaryMatrix: 'BinaryMatrix') -> int:
        y_min = 101
        r_dim,c_dim = binaryMatrix.dimensions()
        COUNT = 1
        r = 0
        while r < r_dim:
            start = 0
            COUNT+=1
            if binaryMatrix.get(r,0) == 1:
                return 0
            else:
                end = c_dim -1
                COUNT+=1
                if not binaryMatrix.get(r,end) == 0:
                    while start <= end:
                        mid = (start+end)//2
                        COUNT+=1
                        if binaryMatrix.get(r,mid)==1:
                            COUNT+=1
                            if binaryMatrix.get(r,mid-1)==0:
                                if y_min > mid:
                                    y_min = mid
                                break
                            else:
                                end = mid -1
                        else:
                            start = mid+1
                r+=1
        print(COUNT)
        if y_min == 101:
            return -1
        return y_min

    def leftMostColumnWithOne1(self, binaryMatrix: 'BinaryMatrix') -> int:
        y_min = 101
        r_dim, c_dim = binaryMatrix.dimensions()
        # COUNT = 1
        r = 0
        while r < r_dim:
            start = 0
            # COUNT += 1
            if binaryMatrix.get(r, 0) == 1:
                return 0
            else:
                end = c_dim - 1
                # COUNT += 1
                if not binaryMatrix.get(r, end) == 0:
                    while start <= end:
                        mid = (start + end) // 2
                        # COUNT += 1
                        if binaryMatrix.get(r, mid) == 1:
                            if y_min > mid:
                                y_min = mid
                            end = mid - 1
                        else:
                            start = mid + 1
                r += 1
        # print(COUNT)
        if y_min == 101:
            return -1
        return y_min

    def leftMostColumnWithOne(self, binaryMatrix: 'BinaryMatrix') -> int:
        r_dim, c_dim = binaryMatrix.dimensions()
        y_min = 101
        # COUNT = 1
        x,y = 0,c_dim-1
        while x < r_dim and y >=0:
            # COUNT += 1
            if binaryMatrix.get(x,y):
                if y_min > y:
                    y_min = y
                y -=1
            else:
                x+=1
        # print(COUNT)
        if y_min == 101:
            return -1
        return y_min





